import React from 'react';

const BlueprintTable = ({ blueprints, onOpen }) => {
  // Filtrar los planos para que solo incluya los de Laura
  const userBlueprints = blueprints.filter(blueprint => blueprint.author === 'Laura');

  return (
    <table>
      <thead>
        <tr>
          <th>Nombre</th>
          <th>Autor</th>
          <th>Total de Puntos</th> {/* Nueva columna para el total de puntos */}
          <th>Acci√≥n</th>
        </tr>
      </thead>
      <tbody>
        {userBlueprints.map((blueprint, index) => (
          <tr key={index}>
            <td>{blueprint.name}</td>
            <td>{blueprint.author}</td>
            <td>{blueprint.points.length}</td> {/* Muestra el total de puntos */}
            <td>
              <button onClick={() => onOpen(blueprint)}>Ver Plano</button>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default BlueprintTable;
